import React, {useState, useEffect} from 'react';
import PropTypes from 'prop-types';
import '../css/fade.css';

const Fader = ({text}) => {

    const [fadeProp, setFadeProp] = useState({
        fade: 'fade-in',
    })

    return (
        <>
        <h1 style={{textAlign: "center"}} className={fadeProp.fade}>{text}</h1>
        </>
    )
}

Fader.defaultProps = {
    text: 'Welcome to our survey on human image recognition',
}

Fader.propTypes = {
    text: PropTypes.string,
}

export default Fader;
